import { Button } from "lively.components/buttons.js";
import { Color } from "lively.graphics/index.js";

export default class StripeButton extends Button {

  static get properties() {
    return {
      haloShadowEnabled: {
        defaultValue: true
      },
      toggleFill: {},
    }
  }

  onDrop(evt) {
    // handy shortcut to quickly assign icons
     const [m] = evt.hand.grabbedMorphs; // pick the first of the grabbed submorphs  
     if (m && m.isLabel) {
       this.label = m.textAndAttributes;
       m.remove();
     }
  }

  onHoverIn(evt) {
    super.onHoverIn(evt);
    if (this.haloShadowEnabled === false) return;
    let ss = this.dropShadow.toJson();
    ss.blur = 10;
    ss.distance = 3;
    this.animate({
      dropShadow: ss, duration: 200
    });
  }

  onHoverOut(evt) {
    super.onHoverOut(evt);
    if (this.haloShadowEnabled === false) return;
    let ss = this.dropShadow.toJson();
    ss.blur = 6;
    ss.distance = 1;
    this.animate({
      dropShadow: ss, duration: 200
    });
  }
}

RadioButton.index.js:
import { Morph } from "lively.morphic";
import { Color, pt } from "lively.graphics/index.js";
import { connect } from "lively.bindings/index.js";
import { Closure } from "lively.lang/index.js";

export default class RadioButton extends Morph {
  static get properties() {
    return {
      indicator: {
        get() {
          return this.getSubmorphNamed('indicator');
        }
      },

      selectionColor: {},
      selectionStyle: {},

      selected: {
        after: ['indicator'],
        defaultValue: false,
        set(bool) {
          this.whenRendered().then(_ => {
            let duration = 200;
            if (!!bool) {
              this.indicator.fill = this.selectionColor;
              this.animate({ opacity: 1, duration });
            } else {
              this.indicator.fill = Color.transparant;
              this.animate({ opacity: .5, duration });
            }
          });
          this.setProperty('selected', !!bool);
        }
      },

      valueFunctionString: {
        defaultValue: '"function (morph) { return morph.value; }"',
        set(funcOrString) {
          this.setProperty('valueFunctionString', funcOrString.toString());
          this.valueFn = undefined;
        }
      }
    }
  }

  reset() {
    let indicator = this.indicator;
    indicator.borderWidth = 1;
    indicator.borderColor = Color.gray
    this.selected = false;

    connect(indicator, 'onMouseUp', this, 'select');
  }

  get morph() {
    let indicator = this.indicator;
    return this.submorphs.find(m => m !== indicator);
  }

  set morph(morph) {
    let indicator = this.indicator;
    this.submorphs.forEach(m => {
      if (m === indicator) return;
      m.remove();
    });
    morph.position = pt(50, 0);
    this.addMorph(morph);
  }

  get value() {
    if (!this.valueFn) {
      let fnCode;
      try {
        fnCode = JSON.parse(this.valueFunctionString);
      } catch(e) {
        fnCode = this.valueFunctionString;
      }
      this.valueFn = Closure.fromSource(fnCode).recreateFunc();
    }

    return this.morph ? this.valueFn(this.morph) : undefined;
  }

  onMouseDown(evt) {
    this.select();
  }

  select() {
    this.selected = true;
    this.owner.setSelection(this);
  }
}
